import React from "react";
import "./style.css";
const Card = props => {
  return (
    <div className="col">
      <div className="card" style={{ width: "17rem" }}>
        <img src={props.image} className="card-img-top" alt="shabuMenu"></img>
        <div className="card-body">
          <p className="card-text">{props.text}</p>
        </div>
      </div>
    </div>
  );
};
export default Card;
